,"Total <- rbind(Total_incidence,Total_Deaths)\n","###����ͼ��\n","library(ggplot2)\n","Total$group <- factor(Total$group, \n","                      levels=c('ASIR','ASDR'), \n","                      ordered=TRUE)\n","p1 <- ggplot(Total,aes(ASR, EAPC, size = case))+  \n","  geom_point(color='#0099CC')+\n","  geom_smooth(data = Total,aes(ASR, EAPC),se = .8,colour='black',span=1) +\n","  scale_size(name = 'Cases in 1990', breaks = c(100,1000,10000,50000),\n","             labels = c(\"<500\",\"500-1,000\",\"10,000-50,000\",\n","                        '>50,000')) + facet_grid(.~group,scales=\"free\") +\n","  theme_light()\n","p1\n","\n","### ����pearson���ϵ������ӦPֵ\n","cor.test(Total_incidence$EAPC,Total_incidence$ASR,method=\"pearson\")\n","cor.test(Total_Deaths$EAPC,Total_Deaths$ASR,method=\"pearson\")"]},{"cell_type":"code","execution_count":25,"id":"00038dbb","metadata":{"execution":{"iopub.execute_input":"2022-02-22T15:53:47.143202Z","iopub.status.busy":"2022-02-22T15:53:47.141677Z","iopub.status.idle":"2022-02-22T15:53:48.060946Z","shell.execute_reply":"2022-02-22T15:53:48.059187Z"},"papermill":{"duration":1.061628,"end_time":"2022-02-22T15:53:48.061146","exception":false,"start_time":"2022-02-22T15:53:46.999518","status":"completed"},"tags":[]},"outputs":[],"source":["####  2019 HDI_EAPC\n","####  2019 ASIR_HDI\n","### ��ȡ HDI����\n","HDI <- read.csv('../input/gbddata/HDI.csv',header = T)\n","names(HDI) <- c('location','HDI')\n","\n","###��ȡ���Է�����\n","Incidence_case_2019 <- subset(EC,EC$year==2019 & \n","                                EC$age=='All Ages' & \n","                                EC$metric== 'Number' &\n","                                EC$measure=='Incidence')\n","Incidence_case_2019 <- Incidence_case_2019[,c(2,8)]  ###ֻȡ��Ҫ�ı���\n","names(Incidence_case_2019)[2] <- 'case'\n","\n","#### ����EAPC\n","EAPC <- subset(EC, EC$age=='Age-standardized' & \n","                 EC$metric== 'Rate' &\n","                 EC$measure=='Incidence')\n","\n","EAPC <- EAPC[,c(2,7,8)]\n","\n","country <- Incidence_case_2019$location  ###��ȡ��������\n","EAPC_cal <- data.frame(location=country,EAPC=rep(0,times=204),UCI=rep(0,times=204),LCI=rep(0,times=204))\n","for (i in 1:204){\n","  country_cal <- as.character(EAPC_cal[i,1])\n","  a <- subset(EAPC, EAPC$location==country_cal)\n","  a$y <- log(a$val)\n","  mod_simp_reg<-lm(y~year,data=a)\n","  estimate <- (exp(summary(mod_simp_reg)[[\"coefficients\"]][2,1])-1)*100\n","  low <- (exp(summary(mod_simp_reg)[[\"coefficients\"]][2,1]-1.96*summary(mod_simp_reg)[[\"coefficients\"]][2,2])-1)*100\n","  high <- (exp(summary(mod_simp_reg)[[\"coefficients\"]][2,1]+1.96*summary(mod_simp_reg)[[\"coefficients\"]][2,2])-1)*100\n","  EAPC_cal[i,2] <- estimate\n","  EAPC_cal[i,4] <- low\n","  EAPC_cal[i,3] <- high\n","}\n","EAPC_cal <- EAPC_cal[,c(1,2)]\n","\n","### �ϲ���������\n","Total <- merge(Incidence_case_2019,EAPC_cal, by='location')\n","Total <- merge(Total,HDI, by='location')\n","Total_incidence <- Total\n","Total_incidence$group <- 'ASIR'"]},{"cell_type":"code","execution_count":26,"id":"b5d71721","metadata":{"execution":{"iopub.execute_input":"2022-02-22T15:53:48.342458Z","iopub.status.busy":"2022-02-22T15:53:48.339998Z","iopub.status.idle":"2022-02-22T15:53:49.376936Z","shell.execute_reply":"2022-02-22T15:53:49.377502Z"},"papermill":{"duration":1.180218,"end_time":"2022-02-22T15:53:49.377699","exception":false,"start_time":"2022-02-22T15:53:48.197481","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["`geom_smooth()` using method = 'loess' and formula 'y ~ x'\n","\n"]},{"data":{"text/plain":["\n","\tPearson's product-moment correlation\n","\n","data:  Total_incidence$EAPC and Total_incidence$HDI\n","t = -2.1539, df = 156, p-value = 0.03278\n","alternative hypothesis: true correlation is not equal to 0\n","95 percent confidence interval:\n"," -0.31765449 -0.01417905\n","sample estimates:\n","       cor \n","-0.1699431 \n"]},"metadata":{},