d_simp_reg)[[\"coefficients\"]][2,2])-1)*100\n","  EAPC_cal[i,2] <- estimate\n","  EAPC_cal[i,4] <- low\n","  EAPC_cal[i,3] <- high\n","}\n","EAPC_cal <- EAPC_cal[,c(1,2)]\n","\n","### �ϲ���������\n","Total <- merge(Deaths_case_2019,EAPC_cal, by='location')\n","Total <- merge(Total,HDI, by='location')\n","Total_Deaths <- Total\n","Total_Deaths$group <- 'ASDR'\n","\n","###�ϲ��������Լ�����������\n","Total <- rbind(Total_incidence,Total_Deaths)\n","### ��ͼ\n","library(ggplot2)\n","Total$group <- factor(Total$group, \n","                      levels=c('ASIR','ASDR'), \n","                      ordered=TRUE)\n","p1 <- ggplot(Total,aes(HDI, EAPC, size = case))+  \n","  geom_point(color='#0099CC')+\n","  geom_smooth(data = Total,aes(HDI, EAPC),se = .8,colour='black',span=1) +\n","  scale_size(name = 'Cases in 1990', breaks = c(100,1000,10000,50000),\n","             labels = c(\"<500\",\"500-1,000\",\"10,000-50,000\",\n","                        '>50,000')) + facet_grid(.~group,scales=\"free\") +\n","  theme_light()\n","p1\n","### ����pearson�����ϵ��\n","cor.test(Total_incidence$EAPC,Total_incidence$HDI,method=\"pearson\")\n","cor.test(Total_Deaths$EAPC,Total_Deaths$HDI,method=\"pearson\")"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":24.260095,"end_time":"2022-02-22T15:53:49.63636","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-02-22T15:53:25.376265","version":"2.3.3"}},"nbformat":4,"nbformat_minor":5}